Somos ese nada de la gente que piensa en nada.
Somos protagonistas del futuro en sueños ,imaginaciones y pensamientos de algun@s...
Podemos volvernos imposibles...
Y frágil mente accesibles...
También somos invisibles para muchos 
O somos el mundo de unos pocos.

Seamos lo que seamos...

Somos las personas correctas 
En sus debidos momentos.

Momentos que se vuelven eternos...

