Tu yo y el resto del mundo...
Aveces duramos horas... en la vida de las personas..
Aveces días o meses 
Y pocas veces duramos toda la vida.

Aprende a detectar esas fechas...
Y comprenderás que hay gente que dio lo mejor de sí. ..
Durante su estancia en su vida...
Y un día caduco...
Y cuando las cosas caducan
...No intentemos obligarlas a que sean eternas.

