Y nunca más me volvió a ver.
Pude ser un buen amigo durante unos meses...hasta que caduqué. 
Pude ser el amante perfecto una noche.
O haber sido 
El apoyo incondicional de alguien que ayude a crecer...
Crecio como persona... y mi paso por su vida caducó. 

Somos eso...

Fechas en la vida de las personas.

Aprovecha cuando alguien te regala l mejor de el/ella.

Y cuando se acabe...
Recuerdalo todo como bonitos recuerdos.

